  description: I have been gaming since I was a kid, when my father and brother first
    got me hooked on Halo for the original XBOX. I started streaming in 2019 on my
    PS4 and have finally found the ways of the PCMR. You can catch me playing a variety
    of FPS or co-op centric games. I love it when I get to play games with friends,
